
var databaseUrl = "ilariomaiolodb";
var collections = ["documents"];
var db = require("mongojs").connect(databaseUrl, collections);


function saveModel(id, clusters_tree, name, dimension,description) {
    db.documents.save({  id: id, dimension: dimension, clusters_tree: clusters_tree, name: name ,description:description}, function (err, saved) {
        if (err || !saved) console.log("Cluster not saved");
        else console.log("Cluster saved");
    })
};

function saveCluster(id, dimension, location, points) {
    db.documents.save({  id: id, dimension: dimension, location: location, points: points}, function (err, saved) {
        if (err || !saved) console.log("Cluster not saved");
        else console.log("Cluster saved");
    })
};


